import React from 'react';
import Button from 'react-bootstrap/Button';
import Card from 'react-bootstrap/Card';
import logo from '../img/rick3.png';
import close from'../img/close.svg';

function card(props) {
  return (
    <Card className="card">
      <Card.Header className='cardHeader'><img src={close} alt='close button' id='close' />
      </Card.Header>
      <Card.Img variant="top" src={props.imagem} />
      <Card.Body className='cardBody'>
        <Card.Title>{props.produto}</Card.Title>
        <Card.Text>
          {props.OldPrice}
        </Card.Text>
        <Button className='buttonCard'>R$ {props.price}</Button>
      </Card.Body>
    </Card>
  );
}

export default card;
